    "description": "A node-link diagram with force-directed layout, depicting character co-occurrence in the novel Les Mis\u00e9rables.",
    "height": 1200,
    "legends": [
        {
            "encode": {
                "symbols": {
                    "enter": {
                        "shape": {
                            "value": "square"
                        },
                        "size": {
                            "value": 64
                        },
                        "strokeWidth": {
                            "value": 2
                        }
                    }
                }
            },
            "fill": "ec-color",
            "orient": "top-right",
            "padding": 4,
            "title": "Top-Level EC"
        },
        {
            "encode": {
                "symbols": {
                    "enter": {
                        "shape": {
                            "value": "circle"
                        },
                        "size": {
                            "value": 64
                        },
                        "strokeWidth": {
                            "value": 2
                        }
                    }
                }
            },
            "fill": "chem-color",
            "orient": "top-right",
            "padding": 4,
            "title": "Chemical class"
        }
    ],
    "marks": [
        {
            "encode": {
                "enter": {
                    "href": [
                        {
                            "signal": "\"http://classyfire.wishartlab.com/tax_nodes/C\" + substring(datum.id, 10)",
                            "test": "datum.type == 'class'"
                        },
                        {
                            "signal": "\"https://www.ebi.ac.uk/interpro/entry/pfam/\" + substring(datum.id, 0, indexof(datum.id, \".\"))",
                            "test": "datum.type == 'domain'"
                        }
                    ],
                    "shape": {
                        "field": "type",
                        "scale": "shape"
                    },
                    "size": {
                        "signal": "4 * datum.size * datum.size"
                    },
                    "stroke": {
                        "value": "white"
                    },
                    "tooltip": {
                        "signal": "if(datum.type == 'class', {'id': datum.id, 'name': datum.name, 'superclass': datum.organic_superclass}, {'id': datum.id, 'name': datum.name, 'ec': datum.ec, 'category': datum.ec_kind})"
                    },
                    "xfocus": {
                        "signal": "cx"
                    },
                    "yfocus": {
                        "signal": "cy"
                    }
                },
                "update": {
                    "cursor": {
                        "value": "pointer"
                    },
                    "fill": [
                        {
                            "field": "organic_superclass",
                            "scale": "chem-color",
                            "test": "colorClasses && datum.type == 'class'"
                        },
                        {
                            "field": "ec_kind",
                            "scale": "ec-color",
                            "test": "colorDomains && datum.type == 'domain'"
                        },
                        {
                            "value": "grey"
                        }
                    ]
                }
            },
            "from": {
                "data": "node-data"
            },
            "name": "nodes",
            "on": [
                {
                    "modify": "node",
                    "trigger": "fix",
                    "values": "fix === true ? {fx: node.x, fy: node.y} : {fx: fix[0], fy: fix[1]}"
                },
                {
                    "modify": "node",
                    "trigger": "!fix",
                    "values": "{fx: null, fy: null}"
                }
            ],
            "transform": [
                {
                    "forces": [
                        {
                            "force": "center",
                            "x": {
                                "signal": "cx"
                            },
                            "y": {
                                "signal": "cy"
                            }
                        },
                        {
                            "force": "x",
                            "strength": {
                                "signal": "gravityX"
                            },
                            "x": "xfocus"
                        },
                        {
                            "force": "y",
                            "strength": {
                                "signal": "gravityY"
                            },
                            "y": "yfocus"
                        },
                        {
                            "force": "collide",
                            "radius": {
                                "signal": "nodeRadius"
                            }
                        },
                        {
                            "force": "nbody",
                            "strength": {
                                "signal": "nodeCharge"
                            }
                        },
                        {
                            "distance": {
                                "signal": "linkDistance"
                            },
                            "force": "link",
                            "links": "link-data",
                            "strength": {
                                "expr": "1"
                            }
                        }
                    ],
                    "iterations": 600,
                    "restart": {
                        "signal": "restart"
                    },
                    "signal": "force",
                    "static": {
                        "signal": "static"
                    },
                    "type": "force"
                }
            ],
            "type": "symbol",
            "zindex": 1
        },
        {
            "encode": {
                "enter": {
                    "stroke": {
                        "value": "black"
                    }
                },
                "update": {
                    "strokeWidth": {
                        "field": "weight"
                    }
                }
            },
            "from": {
                "data": "link-data"
            },
            "interactive": false,
            "transform": [
                {
                    "require": {
                        "signal": "force"
                    },
                    "shape": "line",
                    "sourceX": "datum.source.x",
                    "sourceY": "datum.source.y",
                    "targetX": "datum.target.x",
                    "targetY": "datum.target.y",
                    "type": "linkpath"
                }
            ],
            "type": "path"
        }
    ],
    "padding": 0,
    "scales": [
        {
            "domain": [
                "Oxidoreductase",
                "Transferase",
                "Hydrolase",
                "Lyase",
                "Isomerase",
                "Ligase",
                "Translocase",
                "Unknown"
            ],
            "name": "ec-color",
            "range": [
                "#7F3C8D",
                "#11A579",
                "#3969AC",
                "#F2B701",
                "#E73F74",
                "#80BA5A",
                "#E68310",
                "#c0c0c0"
            ],
            "type": "ordinal"
        },
        {
            "domain": {
                "data": "node-data",
                "field": "organic_superclass"
            },
            "name": "chem-color",
            "range": {
                "scheme": "category20"
            },
            "type": "ordinal"
        },
        {
            "domain": [
                "class",
                "domain"
            ],
            "name": "shape",
            "range": [
                "circle",
                "square"
            ],
            "type": "ordinal"
        },
        {
            "domain": [
                0,
                1
            ],
            "name": "weight",
            "range": {
                "scheme": "greys"
            },
            "type": "linear"
        }
    ],
    "signals": [
        {
            "name": "cx",
            "update": "width / 2"
        },
        {
            "name": "cy",
            "update": "height / 2"
        },
        {
            "bind": {
                "input": "range",
                "max": 50,
                "min": 1,
                "step": 1
            },
            "name": "nodeRadius",
            "value": 8
        },
        {
            "bind": {
                "input": "range",
                "max": 10.0,
                "min": 1.5,
                "step": 0.1
            },
            "name": "weightThreshold",
            "value": 2.0
        },
        {
            "bind": {
                "input": "range",
                "max": 20,
                "min": 1,
                "step": 1
            },
            "name": "rankThreshold",
            "value": 6
        },
        {
            "bind": {
                "input": "range",
                "max": 10,
                "min": -100,
                "step": 1
            },
            "name": "nodeCharge",
            "value": -10
        },
        {
            "bind": {
                "input": "range",
                "max": 100,
                "min": 5,
                "step": 1
            },
            "name": "linkDistance",
            "value": 40
        },
        {
            "bind": {
                "input": "checkbox"
            },
            "name": "static",
            "value": false
        },
        {
            "bind": {
                "input": "checkbox"
            },
            "name": "colorClasses",
            "value": true
        },
        {
            "bind": {
                "input": "checkbox"
            },
            "name": "colorDomains",
            "value": true
        },
        {
            "bind": {
                "input": "range",
                "max": 0.1,
                "min": 0
            },
            "name": "gravityX",
            "value": 0.03
        },
        {
            "bind": {
                "input": "range",
                "max": 0.1,
                "min": 0
            },
            "name": "gravityY",
            "value": 0.03
        },
        {
            "description": "State variable for active node fix status.",
            "name": "fix",
            "on": [
                {
                    "events": "symbol:mouseout[!event.buttons], window:mouseup",
                    "update": "false"
                },
                {
                    "events": "symbol:mouseover",
                    "update": "fix || true"
                },
                {
                    "events": "[symbol:mousedown, window:mouseup] > window:mousemove!",
                    "force": true,
                    "update": "xy()"
                }
            ],
            "value": false
        },
        {
            "description": "Graph node most recently interacted with.",
            "name": "node",
            "on": [
                {
                    "events": "symbol:mouseover",
                    "update": "fix === true ? item() : node"
                }
            ],
            "value": null
        },
        {
            "description": "Flag to restart Force simulation upon data changes.",
            "name": "restart",
            "on": [
                {
                    "events": {
                        "signal": "fix"
                    },
                    "update": "fix && fix.length"
                }
            ],
            "value": false
        }
    ],
    "width": 1200
} );
          </script>
        </body>
